// src/Components/HomePage/HomePage.jsx (or src/HomePage.jsx)
import React from "react";
// Import all section components from their respective folders
import Header from "../Navbar/Header";
import Hero from "../Hero/Hero";
import ServicesSection from "../ServicesSection/ServicesSection";
import FeaturedListings from "../FeaturedListings/FeaturedListings";
import AllPropertiesSection from "../AllPropertiesSection/AllPropertiesSection";
import ContactUsSection from "../ContactUs/ContactUsSection";
import Footer from "../Footer/Footer"; // Assuming you created this component

const HomePage = () => {
  return (
    // Set minHeight to 100vh for the main App container
    <div
      className="HomePage"
      style={{ minHeight: "100vh", display: "flex", flexDirection: "column" }}
    >
      <Header />
      <main style={{ flexGrow: 1 }}>
        <Hero />
        <ServicesSection />
        <FeaturedListings />
        <AllPropertiesSection />
        <ContactUsSection />
      </main>
      <Footer />
    </div>
  );
};

export default HomePage;
